import React from 'react';
import { Card, Button, CardTitle, CardText, Row, Col, Container } from 'reactstrap';
import Axios from 'axios'

class CardHomepage extends React.Component {
    constructor(props){
        super(props)
        this.state={
            investasiTerbaru:[]
        }

    }
    componentDidMount(){
        Axios.get('https://nino-monggovest.herokuapp.com/v1/api/investment_terbaru').then(invTerbaru=>{
            this.setState({
                investasiTerbaru : invTerbaru.data.data
            })
        }).catch(err=>{
            console.log(err)
        })
    }
    render() {
        const cards = this.state.investasiTerbaru.map(investasi=>{
            return(
                <Row className='ard-item px-0 my-5 my-md-0 col-md-4 col-12' key={investasi.gambar}>
                <Col sm="6">
                    <Card body>
                        <CardTitle>Special Title Treatment</CardTitle>
                        <CardText>With supporting text below as a natural lead-in to additional content.</CardText>
                        <Button>Go somewhere</Button>
                    </Card>
                </Col>
            </Row>
            )
        })



        return (
            <div>
                <Container>
                    {cards}
                </Container>
            </div>

        );
    }
};

export default CardHomepage;
